:1:"0";s:6:"vod_tv";s:0:"";s:11:"vod_weekday";s:0:"";s:8:"vod_area";s:6:"大陆";s:8:"vod_lang";s:6:"国语";s:8:"vod_year";s:4:"2004";s:11:"vod_version";s:0:"";s:9:"vod_state";s:0:"";s:10:"vod_author";s:0:"";s:11:"vod_jumpurl";s:0:"";s:7:"vod_tpl";s:0:"";s:12:"vod_tpl_play";s:0:"";s:12:"vod_tpl_down";s:0:"";s:9:"vod_isend";i:1;s:8:"vod_lock";i:0;s:9:"vod_level";i:0;s:13:"vod_copyright";i:0;s:10:"vod_points";i:0;s:15:"vod_points_play";i:0;s:15:"vod_points_down";i:0;s:8:"vod_hits";i:351;s:12:"vod_hits_day";i:205;s:13:"vod_hits_week";i:143;s:14:"vod_hits_month";i:498;s:12:"vod_duration";s:0:"";s:6:"vod_up";i:256;s:8:"vod_down";i:167;s:9:"vod_score";s:3:"2.0";s:13:"vod_score_all";i:1752;s:13:"vod_score_num";i:876;s:8:"vod_time";i:1567084147;s:12:"vod_time_add";i:1566468082;s:13:"vod_time_hits";i:0;s:13:"vod_time_make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:3126:"康熙年间，康熙帝与一僧雪印(实为康熙之父委派)打赌，怪僧承诺将街头两名乞丐；当朝宰相明珠之子纳兰容若；海师提督施郎之子施仕伦训练成国之栋梁，朝廷重臣果然，几年后乞丐之一“结巴’成了口若悬河的弄臣，另一瘦弱者俨然成为名震全国的大将军。其后二人与纳兰容若、施仕伦四人官居极品，权倾朝野，成为康熙面前红极一时的御前四宝。四人虽结为兄弟，却性格独异，冲突不断，时而搭帮共进，时而互相拆台。但他们在与“三大奸臣”较量时，却能同仇敌忾，为民请命。&nbsp;　　歌舞升平之胜景，却发现所到之处，贪官污吏设下玄机重重，土豪恶霸扰得怨声载道。御前四宝每次随驾前往，他们各展奇才，或明察秋毫，或忠勇善战，或嘻笑怒骂，或装疯卖傻，一路斩奸除霸，为民请命，每每化险为夷建树奇功。&nbsp;　　御前四宝在复杂的官场、变幻的江湖中，纵横驰骋，演绎了一幕幕啼笑皆非，回肠荡气的宫廷喜剧，施仕伦，因具有残疾，康熙赐施‘不全’。历任江都知县，顺天府知府，仓厂总督，加太子太保御。为官清廉公正，善断案讼狱.不思权益.文武百官皆惮甚深.人称“施青天”。贪官恶霸屡欲致他于死地.但皆被他识破诡计，终将恶人绳之以法。纳兰容若，御前一等侍卫。文武双全，尤以文才名贯天下。多愁善感，长于诗词，人称李后主转世。一身书卷之气，貌似迂腐，内心精明，文才武略，常使奸党闻风丧胆。他疾恶如仇，也不容小人，喜揭穿林天宝瞒天过海的小伎俩。林天宝，能说会道，善溜须拍马，凭如簧之舌平步青云，深得康熙宠爱。貌似小人但心存正气，常能不拘常理，出奇制胜。此人为人八面玲拢，喜贪便宜，好利忘义，常自作聪明，算计于人却屡屡作茧自缚，身陷险境，加上向来惧内，被世人传为笑谈。谢放，绿林出身，招安后因功官拜九门提督。对康熙忠心耿耿，为人仗义，武功极高，威震江湖，得天下侠士敬重，令江洋大盗闻风丧胆。性格木讷忠厚，常遭林天宝等人算计，但每次都如有天助，反败为胜，堪称福将。天下女子视其为偶像，故屡屡卷入桃色事件之中。&nbsp;　　此剧借御前四宝的怪志奇才，将一个个小故事串接起来，揭露了混迹于封建社会官场的奸臣们的种种恶行和土豪恶霸们的种种劣迹，赞扬了清官们同仇敌们，同心协力，为民请命，为国分忧的高尚品德，特别是歌颂了当时的下层劳动人民反抗黑暗压迫，追求美好生活的精神。此剧在历史题材的电视剧中独辟蹊径，不但有坏人当道好人受屈的悲悯之景，有正义伸张、除暴安良的大快人心的场面，更多的是不同性格的碰撞，出乎意料的情节带来的笑声。使全剧在不断出现的喜剧情境之中，融入悲剧的震撼，正剧的畅快。";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:2683:"第01集$https://www.183757.com/20190827/05mVC67H/index.m3u8#第02集$https://www.183757.com/20190827/gbSVqiOk/index.m3u8#第03集$https://www.183757.com/20190827/x4dmOoHq/index.m3u8#第04集$https://www.183757.com/20190829/9C0BW54v/index.m3u8#第05集$https://www.183757.com/20190827/g73CJT4N/index.m3u8#第06集$https://www.183757.com/20190827/ImR49psv/index.m3u8#第07集$https://www.183757.com/20190827/rkbSn7zU/index.m3u8#第08集$https://www.183757.com/20190827/9xNotT2Z/index.m3u8#第09集$https://www.183757.com/20190827/rlGAo6gC/index.m3u8#第10集$https://www.183757.com/20190827/G0kLtTPV/index.m3u8#第11集$https://www.183757.com/20190827/R96Gt4oL/index.m3u8#第12集$https://www.183757.com/20190827/8pAF4klr/index.m3u8#第13集$https://www.183757.com/20190827/1QSbN6Ee/index.m3u8#第14集$https://www.183757.com/20190827/PEZKMCL6/index.m3u8#第15集$https://www.183757.com/20190827/Yct34W9v/index.m3u8#第16集$https://www.183757.com/20190827/aiMyjVqv/index.m3u8#第17集$https://www.183757.com/20190827/BgpqjEt2/index.m3u8#第18集$https://www.183757.com/20190827/5NlT8ybR/index.m3u8#第19集$https://www.183757.com/20190827/QgXb9dE1/index.m3u8#第20集$https://www.183757.com/20190827/zHCiZXwd/index.m3u8#第21集$https://www.183757.com/20190827/9B5J1ELk/index.m3u8#第22集$https://www.183757.com/20190827/n8Zuq293/index.m3u8#第23集$https://www.183757.com/20190827/6WKoPLUk/index.m3u8#第24集$https://www.183757.com/20190827/IS60mdE9/index.m3u8#第25集$https://www.183757.com/20190827/iPGmHwbx/index.m3u8#第26集$https://www.183757.com/20190827/7sXj53n9/index.m3u8#第27集$https://www.183757.com/20190827/bRJefXGA/index.m3u8#第28集$https://www.183757.com/20190827/w6z4OTid/index.m3u8#第29集$https://www.183757.com/20190827/xt37AzUk/index