，更多的却是所有走过青春的人都能体会到的灼热温度。导演姜凯阳说，在他的记忆里，那个年代的天很蓝，水很清，树很绿，人的眼睛很亮……对那个逝去年代的深深的怀恋是他喜欢这个剧的原因。两个月的拍摄，大家都在努力在时间隧道中逆行，寻找着那个年代的感觉。&nbsp;　　它是女兵版《士兵突击》&nbsp;　　《我的燃情岁月》是以女主角方捷(《我的青春谁作主》中李霹雳的扮演者林园饰演)回忆的方式，讲述的一部女兵成长史，该角色和《士兵突击》中的许三多一样，都是一个贯穿全剧的人物，“女版许三多”的称谓由此而来。“如果从励志的角度说，倒也可以这么评价。”柳叶刀说，方捷和许三多的性格都很执着，“有时，过度执着会容易让人受不了，许三多是这样，方捷也是。”我的燃情岁月的演职员 · · · · · · ( 全部 15 )";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:1280:"第01集$https://www.qzamfz.com/20190829/LQJrHNtz/index.m3u8#第02集$https://www.qzamfz.com/20190829/36OajYvX/index.m3u8#第03集$https://www.qzamfz.com/20190829/8ulATx2v/index.m3u8#第04集$https://www.qzamfz.com/20190829/e9zIWpgt/index.m3u8#第05集$https://www.qzamfz.com/20190829/bdF3rNZh/index.m3u8#第06集$https://www.qzamfz.com/20190829/2BTiaKUG/index.m3u8#第07集$https://www.qzamfz.com/20190829/aDpGSqNJ/index.m3u8#第08集$https://www.qzamfz.com/20190829/SMgoVi64/index.m3u8#第09集$https://www.qzamfz.com/20190829/f4vVHjwA/index.m3u8#第10集$https://www.qzamfz.com/20190829/1P4prK6H/index.m3u8#第11集$https://www.qzamfz.com/20190829/YqEbsTy1/index.m3u8#第12集$https://www.qzamfz.com/20190829/xGoBS9aQ/index.m3u8#第13集$https://www.qzamfz.com/20190829/9gfYSjAh/index.m3u8#第14集$https://www.qzamfz.com/20190829/plSaCqDT/index.m3u8#第15集$https://www.qzamfz.com/20190829/6nesFjLN/index.m3u8#第16集$https://www.qzamfz.com/20190829/PJFz1N0r/index.m3u8#第17集$https://www.qzamfz.com/20190829/JcGKMnNO/index.m3u8#第18集$https://www.qzamfz.com/20190829/cao02YJe/index.m3u8#第19集$https://www.qzamfz.com/20190829/ux4pYW0A/index.m3u8#第20集$https://www.qzamfz.com/20190829/FtIlp2Ba/index.m3u8#第21集$https://www.qzamfz.com/20190829/pTNRYx3h/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:13;s:9:"type_name";s:9:"国产剧";s:7:"type_en";s:9:"guochanju";s:9:"type_sort";i:1;s:8:"type_mid";i:1;s:8:"type_pid";i:2;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"typ